import React from 'react';
import { Routes, Route } from 'react-router-dom';
import HomePage from './HomePage'; // Replace with the actual path to your home page component
import BookingPage from './BookingPage'; // Replace with the actual path to your booking page component
import './Main.css'; // Import your CSS file for styling

function Main() {
  return (
    <main>
      {/* Routes */}
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/booking" element={<BookingPage />} />
        {/* Add more routes as needed */}
      </Routes>
    </main>
  );
}

export default Main;
